import './App.css';
import React, { useState, useEffect } from 'react';
function App() {
  const [state, setState] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/api/issuers')
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                setState(data);
            })
            .catch(error => {
                console.error('There was a problem with the fetch operation:', error);
            });
    }, []);

    return (
        <div>
            <h1>React Application</h1>
            <div>
                {state.map(obj => (
                    <div key={obj.id}>
                        <h2>ID: {obj.id}</h2>
                        <p>Symbol: {obj.symbol}</p>
                        <p>Date: {obj.date}</p>
                        <p>Close Price: {obj.closePrice}</p>
                        <p>Volume: {obj.volume}</p>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default App;
